pragma solidity ^0.8.4;

contract HOMES is ERC20, ERC20Burnable, Pausable, AccessControl {
    bytes32 public constant ADMIN = keccak256("ADMIN");
    mapping(address => lockInfo) public lockList;
    bool public underLock = true;

    constructor() ERC20("AI HOMES TOKEN", "HOMES") {
        _grantRole(DEFAULT_ADMIN_ROLE, msg.sender);
        _grantRole(ADMIN, msg.sender);
        _mint(msg.sender, 1000000000 * 10 ** decimals());
    }

    struct lockInfo{
        uint256 lockAmount;
    }

    modifier checkLock(address from, uint256 amount){
        if(from != address(0) && underLock == true){
            if(whenNotLock(from,amount) == false){
                revert(
                    string(
                        abi.encodePacked(
                            "Lock: Your token is lock"
                        )
                    )
                );
            }
        }
        _;
    }

    function whenNotLock(address from, uint256 amount) private view returns (bool){
        bool check = true;
        uint256 balance = IERC20(address(this)).balanceOf(from);
        if(balance - amount < lockList[from].lockAmount){
            check = false;
        }

        return check;
    }

    function pause() external onlyRole(ADMIN) {
        _pause();
    }

    function unpause() external onlyRole(ADMIN) {
        _unpause();
    }

    function mint(address to, uint256 amount) external onlyRole(ADMIN) {
        _mint(to, amount);
    }

    function lockAddress(address account, uint256 amount) external onlyRole(ADMIN) {
        lockList[account] = lockInfo(amount);
    }

    function unlockAddress(address from) external onlyRole(ADMIN) {
        delete lockList[from];
    }

    function getLockListByAddress(address account) external view returns (lockInfo memory){
        return lockList[account];
    }

    function setUnderLock(bool _underLock) public onlyRole(ADMIN) {
        underLock = _underLock;
    }

    function _beforeTokenTransfer(address from, address to, uint256 amount)
        internal
        whenNotPaused
        checkLock(from,amount)
        override
    {
        super._beforeTokenTransfer(from, to, amount);
    }
}

